import './style.css';

const GiftCertificates = () => (
  <div className="page">
    <h1>Gift Certificates</h1>
    <p>Give the gift of reading! Purchase a digital gift card for any amount and share it with friends.</p>
  </div>
);

export default GiftCertificates;
